const serverUrls = {
  http: 'http://m.baidu.com/tcbox?action=pblog',
  https: 'https://mbd.baidu.com/tcbox?action=pblog'
}; // v1

const pblogUrlProtocol = serverUrls[isHTTPS() ? 'https' : 'http']; // v1

const testPblogUrlProtocol = 'http://bjyz-mco-searchbox201609-m12xi3-044.bjyz.baidu.com:8080/tcbox?action=pblog'; // v2

const ztboxUrlProtocol = 'https://mbd.baidu.com/ztbox?action=zpblog'; // v2

const testZtboxUrlProtocol = 'http://bjyz-mco-searchbox201609-m12xi3-044.bjyz.baidu.com:8080/ztbox?action=zpblog'; // export const testZtboxUrlProtocol = 'http://cp01-dqx.epc.baidu.com:8062/ztbox?action=zpblog';
// SDK,  http, httphttps

const baiduTongJiSDKUrl = 'https://hm.baidu.com/hm.js';

/**
 * @file send 
 * @author wangbing11(wangbing11@baidu.com)
 */

const createImg = function (src) {
  let img = document.createElement('img');
  img.width = 1;
  img.height = 1;
  img.src = src;
  return img;
}; // 


const callbackWaitingTime = 100;
/**
 * 
 *
 * @param {string} url 
 * @param {Object} param 
 * @param {Function} callback 
 * @param {Tracker} tracker 
 */

function imgPing(url, param, callback, tracker) {
  // URL
  url = renderUrl(url, {
    data: param
  });
  let img = createImg(url);
  let isCallbacked = false; //  100 ms 100ms

  setTimeout(function () {
    if (callback && !isCallbacked) {
      callback(tracker);
      isCallbacked = true;
    }
  }, callbackWaitingTime);

  img.onload = img.onerror = function () {
    img = null; // 

    if (callback && !isCallbacked) {
      callback(tracker);
      isCallbacked = true;
    }
  };
}
/**
 * Navigator.sendBeacon
 *
 * @param {string} url 
 * @param {Object} param 
 * @param {Function} callback 
 * @param {Tracker} tracker 
 */


function beaconSend(url, param, callback, tracker) {
  // URL
  url = renderUrl(url, {
    data: param
  });
  window.navigator.sendBeacon(url);
  callback(tracker);
}

function smartSend(url, param, callback = noop, useSendBeacon = 0, tracker) {
  // RD-sendBeacon
  // useSendBeacon0useSendBeacon1SendBeaconuseSendBeacon2SendBeacon
  if (typeof window.navigator.sendBeacon === 'function' && (tracker.model.useSendBeacon && useSendBeacon === 0 || useSendBeacon === 1)) {
    return beaconSend(url, param, callback, tracker);
  }

  return imgPing(url, param, callback, tracker);
}

/**
 * @file Tracker 
 * @author wangbing11(wangbing11@baidu.com)
 */

const defaultVersion = '1.0'; // -

const defaultAppid = '1'; // -web 

const defaultCateid = '99'; // -

const defaultActiontype = '0'; // -

const defaultFrom = 'act'; // 

const DefaultDuration = 3; // event 

const eventArgsInputPattern = ['type', 'value', 'ext'];
/**
 * 
 *
 * @class 
 * @param {Objec} opt 
 */

/* eslint-disable */

function Tracker(opt) {
  /* eslint-enable */
  // tracker.model 
  this.model = {}; // 

  setBasicConfig(this.model, opt); // 

  if (this.get('isBaiduTongJi')) {
    // 
    window._hmt = window._hmt || [];
    let src = baiduTongJiSDKUrl + '?' + this.get('baiduTongJiId');
    loadScript(src);
  } // PV


  if (this.get('autoPvTrack')) {
    // PV
    this.send({
      type: 'event',
      fields: ['pageAutoPv']
    });
  } // 


  if (this.get('autoTimingTrack')) {
    // 
    this.regestTimingReportor(['pageAutoTiming']);
  }
}

Tracker.prototype.set = function (fieldName, fieldValue) {
  this.model[fieldName] = fieldValue;
};

Tracker.prototype.get = function (fieldName) {
  return this.model[fieldName];
};
/**
 * 
 *
 * @param {Object} opt 
 * @param {string} opt.type event | timing
 * @param {string} opt.fields 
 *
 */


Tracker.prototype.send = function ({
  type,
  fields
}) {
  // 
  let callback;
  let sendData;
  let opt;
  let useSendBeacon = 0;

  if (type === 'event') {
    //  ['event', {}, function() {}] 
    if (fields && isObject(fields[0])) {
      opt = fields[0];

      if (isFunction(fields[1])) {
        callback = fields[1];
      }
    } //  ['event', 'type']
    else {
        opt = transformInput(eventArgsInputPattern, fields);
      } // 


    sendData = generateEventData(this.model, opt); // useSendBeacon

    if (opt.useSendBeacon) {
      useSendBeacon = opt.useSendBeacon;
    } // , https://tongji.baidu.com/web/help/article?id=236&type=0


    if (this.get('isBaiduTongJi')) {
      let {
        page,
        type,
        value
      } = sendData.actiondata.content || {};

      window._hmt.push(['_trackEvent', page, type, value]);
    }
  } else if (type === 'timing') {
    sendData = generateDurationData(this.model, fields);
  }

  let url = this.get('testMode') ? testPblogUrlProtocol : pblogUrlProtocol; // v2appnamefromcfromsmfw

  if (this.model.version === '2.0') {
    url = this.get('testMode') ? testZtboxUrlProtocol : ztboxUrlProtocol;
    url = this.model.testUrl || url;
    url = renderUrl(url, this.model.queryParams);
  } // 


  smartSend.apply(this, [url, sendData, callback, useSendBeacon, this]);
};
/**
 * 
 *
 * @param {Array} fields 
 */


Tracker.prototype.regestTimingReportor = function (fields = []) {
  //  timing ID 
  if (!this.get('timingId')) {
    throw 'timing ID is required!';
  }

  let timingTasks = this.get('timingTasks');
  let duration = this.get('duration');
  fields = transformInput(eventArgsInputPattern, fields);
  let isExist = timingTasks.find(task => task.eventName === fields.type); // starttime

  fields.starttime = Date.now(); // 

  if (!isExist) {
    // // 
    this.send({
      type: 'timing',
      fields
    });
    let timingIntevalId = setInterval(() => {
      this.send({
        type: 'timing',
        fields
      });
    }, duration * 1000); // 

    timingTasks.push({
      timingIntevalId,
      isReporting: true,
      eventName: fields.type,
      fields
    });
  }
};
/**
 * 
 */


Tracker.prototype.stopAllTimingReportor = function () {
  let timingTasks = this.get('timingTasks');
  timingTasks.forEach(function (timingTask) {
    timingTask.isReporting = false;
    clearInterval(timingTask.timingIntevalId);
  });
};
/**
 * 
 */


Tracker.prototype.startAllTimingReportor = function () {
  let timingTasks = this.get('timingTasks');
  let duration = this.get('duration');
  timingTasks.forEach(timingTask => {
    timingTask.isReporting = true; // starttime

    timingTask.fields.starttime = Date.now();
    this.send({
      type: 'timing',
      fields: timingTask.fields
    });
    timingTask.timingIntevalId = setInterval(() => {
      this.send({
        type: 'timing',
        fields: timingTask.fields
      });
    }, duration * 1000);
  });
};
/**
 * 
 *
 * @param {Array} fields 
 */


Tracker.prototype.endTimingReportor = function (fields) {
  fields = transformInput(eventArgsInputPattern, fields);
  let timingTasks = this.get('timingTasks');
  let newTimingTasks = [];
  timingTasks.forEach(timingTask => {
    let {
      timingIntevalId,
      eventName
    } = timingTask;

    if (eventName === fields.type) {
      clearInterval(timingIntevalId);
    } else {
      newTimingTasks.push(timingTask);
    }

    this.set('timingTasks', newTimingTasks);
  });
}; // 


Tracker.prototype.removeAllTimingReportor = function () {
  let timingTasks = this.get('timingTasks');
  timingTasks.forEach(timingTask => {
    clearInterval(timingTask.timingIntevalId);
  });
  timingTasks = [];
};
/**
 * 
 *
 * @param {Object} model tracker.model  tracker 
 * @param {Object} opt 
 * @param {string} opt.type 
 * @param {string} opt.value 
 * @param {Object} opt.ext 
 * @return {Object} 
 */


function generateEventData(model, opt) {
  let data = {
    cateid: model.cateid,
    actiondata: {
      // server_id
      id: model.trackerId,
      // 
      type: '0',
      timestamp: Date.now(),
      content: {
        // , page  opt 
        page: opt.page || model.page,
        // 
        source: model.source,
        // 
        from: model.from,
        // -
        type: opt.type,
        // -
        value: opt.value,
        // -
        ext: opt.ext
      }
    }
  }; // v1 v2

  if (model.version === '1.0') {
    // ab
    data.actiondata.abtest = model.abtest; // 

    data.actiondata.inBox = model.inBox; // 

    data.actiondata.network = model.network;
    data.appid = model.appid;
    data.actiontype = model.actiontype;
  }

  return data;
}
/**
 * 
 *
 * @param {Object} model tracker.model  tracker 
 * @param {Object} opt 
 * @param {string} opt.type 
 * @param {string} opt.value 
 * @param {string} opt.ext 
 * @param {string} opt.starttime 
 * @return {Object} 
 */


function generateDurationData(model, opt) {
  let data = {
    cateid: model.cateid,
    actiondata: {
      // server_id
      id: model.timingId,
      // 
      type: '1',
      timestamp: Date.now(),
      // 
      starttime: opt.starttime,
      content: {
        duration: model.duration,
        option: {
          // 
          page: model.page,
          // 
          source: model.source,
          // 
          from: model.from,
          // -
          type: opt.type,
          // -
          value: opt.value,
          // -
          ext: opt.ext
        }
      }
    }
  }; // v1 v2

  if (model.version === '1.0') {
    // ab
    data.actiondata.abtest = model.abtest; // 

    data.actiondata.inBox = model.inBox; // 

    data.actiondata.network = model.network;
    data.appid = model.appid;
    data.actiontype = model.actiontype;
  }

  return data;
}
/**
 *  Tracker
 *
 * @param {Object} model tracker.model  tracker
 * @param {Object} opt 
 * @param {string} opt.trackerName 
 * @param {string} opt.trackerId ID
 * @param {string} opt.timingId 
 */


function setBasicConfig(model, opt) {
  // 
  model.trackerName = opt.trackerName; // ID

  model.trackerId = opt.trackerId || ''; // ID

  model.timingId = opt.config && opt.config.timingId || ''; //  sendBeanAPI

  model.useSendBeacon = opt.config && opt.config.useSendBeacon || false; // sdk-v2

  model.version = opt.config && opt.config.version || defaultVersion; // 

  if (opt.config && isBoolean(opt.config.testMode)) {
    model.testMode = opt.config.testMode;
  } else {
    model.testMode = false;
  } // -v2


  model.testUrl = opt.config && opt.config.testUrl || ''; // PV

  if (opt.config && isBoolean(opt.config.autoPvTrack)) {
    model.autoPvTrack = opt.config.autoPvTrack;
  } else {
    model.autoPvTrack = false;
  } // 


  if (opt.config && isBoolean(opt.config.autoTimingTrack)) {
    model.autoTimingTrack = opt.config.autoTimingTrack;
  } else {
    model.autoTimingTrack = false;
  } // -v2


  model.queryParams = opt.config && opt.config.queryParams || {}; //  version = 2.0 v

  if (model.version) {
    model.queryParams.v = model.version;
  } // ID-


  model.appid = opt.config && opt.config.appid || defaultAppid; // -web 

  model.cateid = opt.config && opt.config.cateid || defaultCateid; // -

  model.actiontype = opt.config && opt.config.actiontype || defaultActiontype; // -

  model.from = opt.config && opt.config.from || defaultFrom; // 

  model.duration = opt.config && opt.config.duration || DefaultDuration; // 

  model.source = opt.config && opt.config.source || getQueryParams('idfrom') || ''; // ,

  model.inBox = IS_BOX ? '1' : '0';
  model.abtest = opt.config && opt.config.abtest || ''; // 

  model.network = opt.config && opt.config.network || ''; //  window.location.hostname + window.location.pathname

  model.page = opt.config && opt.config.page || window.location.hostname + window.location.pathname; // 

  model.baiduTongJiId = opt.config && opt.config.baiduTongJiId;
  model.isBaiduTongJi = !!(opt.config && opt.config.baiduTongJiId); // 

  model.timingTasks = [];
}

